import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faPhone, faEnvelope } from "@fortawesome/free-solid-svg-icons";
import Link from "./Link";
import { useState } from "react";

function Contact() {
  const [isPhoneClicked, setIsPhoneClicked] = useState(false);
  const [isEmailClicked, setIsEmailClicked] = useState(false);

  const elements = [
    {
      state: isPhoneClicked,
      setter: setIsPhoneClicked,
      icon: faPhone,
      size: "2x",
    },
    {
      state: isEmailClicked,
      setter: setIsEmailClicked,
      icon: faEnvelope,
      size: "2x",
    },
  ];

  return (
    <div className="bg-lightTone">
      <div className="max-w-screen-lg mx-auto flex flex-col items-center py-padY">
        <div className="font-racing text-5xl p-10 text-darkTone">
          Get in Touch
        </div>
        <div className="pb-10">
          <div className="flex flex-row p-7 gap-10 ">
            {elements.map((item, index) => (
              <div className="w-30 h-30">
                <Link icon={item.icon} size={item.size} />
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default Contact;
